import React from "react";
import Card from "./Card";

const CardArray = ({ robots }) => {
  robots.map((robot, index) => {
    return (
      <Card
        key={robot[index].id}
        id={robot[index].id}
        name={robot[index].name}
        email={robot[index].email}
      />
    );
  });
};

export default CardArray;
